import React from "react";
import Slider from "react-slick";
import './slider.scss';


const SliderTemplates = (props) => {
    let template = null;
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      ...props.settings
    }

    switch(props.type){
        case('city'):
          template = props.data.map((item,i) => {
            return(
              <div>
               {item.name}
              </div>
            )
          })
          break;
        default:
          template = null;
    }

    return (
      <div className ={`${this.props.type}-slider`}>
        <Slider {...settings}>
          {template}
        </Slider>
      </div>
    );
}

export default SliderTemplates;
